private BSPTree<T> recurseTransform(final BSPTree<T> node, final Hyperplane<S> transformed, final Transform<S, T> transform, final Map<BSPTree<T>, BSPTree<T>> map){
    final BSPTree<T> transformedNode;
    if (node.getCut() == null) {
        transformedNode = new BSPTree<T>(node.getAttribute());
    } else {
        @SuppressWarnings("unchecked")
        BoundaryAttribute<T> attribute = (BoundaryAttribute<T>) node.getAttribute();
        if (attribute != null) {
            final SubHyperplane<T> tPO = (attribute.getPlusOutside() == null) ? null : transform.apply(attribute.getPlusOutside(), hyperplane, transformed);
            final SubHyperplane<T> tPI = (attribute.getPlusInside() == null) ? null : transform.apply(attribute.getPlusInside(), hyperplane, transformed);
            // we start with an empty list of splitters, it will be filled in out of recursion
            attribute = new BoundaryAttribute<T>(tPO, tPI, new NodesSet<T>());
        }
        transformedNode = new BSPTree<T>(transform.apply(node.getCut(), hyperplane, transformed), recurseTransform(node.getPlus(), transformed, transform, map), recurseTransform(node.getMinus(), transformed, transform, map), attribute);
    }
    map.put(node, transformedNode);
    return transformedNode;
}

